import { Container, Row, Col } from "react-bootstrap";
import ListNotes from "../components/ListNotes";

const ArchivedNotes =(props)=> {
    let datos = props.data;
    const switchViews = props.switchViews;
    const editNote = props.editNote;
    const deleteNote =  props.deleteNote;

    return(
        <>
            <Container>
                <Row>
                    <Col>
                        <h2>Archived Notes</h2>
                    </Col>
                    <Col>
                        <h1 onClick={switchViews} >{'<'}Go back to unarchived Notes</h1>
                    </Col>
                </Row>
            </Container>
            <Container>
                <ListNotes data={datos} editNote={editNote} deleteNote={deleteNote} />
            </Container>
        </>
    );
}

export default ArchivedNotes;
